import React, { Component } from 'react'
import axios from 'axios'
import { useParams } from "react-router-dom";
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';
import mark from '../components/icons/mark.png'
import L from 'leaflet';

import Cards from './Map'


export default class Servicios extends Component {
    state = {
        prop: []
    }

    componentDidMount() {
        axios.get('http://localhost:3001/propiedades')
            .then(res => {
                const prop = res.data;
                this.setState({ prop });
            })
    }


    render() {
        const { prop } = this.state

        let { id } = useParams();

        let Icon = L.icon({
            iconUrl: mark,
            iconRetinaUrl: mark,
            iconAnchor: [5, 55],
            popupAnchor: [10, -44],
            iconSize: [30, 35],
        });

        return (
            <div>

                <h1>{prop.tittle}</h1>

            </div>
        )
    }
}
